import styled from "styled-components";

export const NavbarStyle = styled.div`
     height: 36px;
     max-width: 1100px;
     margin-top: 79px auto;
     color: #B5B5B5;
     display: flex;
     justify-content: space-around;
     flex-wrap: wrap;

`
export const Menu = styled.ul`
     display: flex;
     :align-items
`
